import React, { useEffect, useState } from 'react';
import { fetchData } from './fetchCall.js';

const access_token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjVkNTExOGYzZmJlNjI5MzE0OTc0Y2EwYiIsImlhdCI6MTU2NjYzOTkyN30.BOH7VjIdBgXL6riwgGGYFgVU9LVQaXGmLMgvWzVZ8ps";
const getStatusUrl = "https://dev.mai.family/api/v1/child/5d5119befbe629314974ca0d/assessment/5ce28e5b990bef450f1fdfc9";

const Status = () => {
    const [response, setResponse] = useState({
        data: {
            data:{
                data : {
                    description: "Actively looking for ways to help people, and understanding their feelings.",
                    displayStatus: "CONTINUE",
                    status : 'PENDING'
                }
            }
        }
    })
    const getAssessment = async() => {
        const response = await fetchData(getStatusUrl, access_token);
        setResponse(response);
        return response;
        }

    useEffect(() => {
          getAssessment();
        },[])

    return (
    <div className="w3-card-4 w3-blue" >
    <div className="w3-container question">
      {console.log(response.data.data.data)}
      <h4>{response.data.data.data.status}</h4>
    </div>
    <div className="w3-container">
    <div className="">
       <button className="w3-button w3-hover-white w3-border w3-border-white w3-round-large">{response.data.data.data.displayStatus}</button>
    </div>
  </div>
  <div class="w3-container">
  <h2>Description</h2>
  <div class="w3-panel w3-card-4"><p>{response.data.data.data.description}</p></div>
  <div class="w3-panel w3-card"><p>{response.data.data.data.status}</p></div>
 </div>
  </div>);
}

export default Status;
